import React from 'react'
import {useNavigate} from 'react-router-dom';

const LandingPage = () => {

    const navigate = useNavigate();

    const navigateLogin=()=>{
        console.log("Login Page");
        navigate('/adminlogin');
    }

    const navigateAdminLogin=()=>{
        console.log("Signup Page");
        navigate('/userlogin');
    }

    const style = {
      display: "inline-grid",
      paddingTop: "25rem",
      paddingLeft: "5rem"
  }
  const style1 = {
    "backgroundImage": `url("images/bgimg3.jpg")`,
    "backgroundRepeat": "no-repeat",
    "backgroundSize": "cover",
    position: "absolute",
    height: "100%",
    width: "100%",
}

  return (
    <div style={style1}> 
    <div style={style}>
      <button type="button" className="btn btn-info mx-2 my-2" onClick={navigateLogin}>AdminLogin</button>
      <button type="button" className="btn btn-info mx-2 my-2" onClick={navigateAdminLogin}>User Login</button>
    </div>
    </div>
  )
}

export default LandingPage
